insert into OBRA values (	5	,	'La Gioconda'	,	'Es una ópera en cuatro actos con música de Amilcare Ponchielli y libreto en italiano de Arrigo Boito.'	,	to_date(	'20/01/2013'	, 'dd/mm/yyyy'),	9	,	1	,	9	,	9	,	6	,	1	);
insert into OBRA values (	6	,	'Otelo'	,	'Es una ópera en cuatro actos con música de Giuseppe Verdi y libreto en italiano de Arrigo Boito, a partir de la obra de Shakespeare, Otelo.'	,	to_date(	'25/03/2013'	, 'dd/mm/yyyy'),	8	,	2	,	8	,	8	,	12	,	2	);
insert into OBRA values (	7	,	'Pagliacci'	,	'es un drama en dos actos con un prólogo. La música y el libreto en italiano pertenecen al compositor Ruggero Leoncavallo y relata la tragedia de un esposo celoso y su esposa en una compañía teatral de la comedia del arte.'	,	to_date(	'14/02/2013'	, 'dd/mm/yyyy'),	7	,	3	,	7	,	7	,	11	,	3	);
insert into OBRA values (	8	,	'Le nozze di Figaro'	,	'es una ópera bufa en cuatro actos con música de Wolfgang Amadeus Mozart y libreto en italiano de Lorenzo da Ponte, basado en la pieza de Pierre Augustin Caron de Beaumarchais, Le mariage de Figaro. Fue compuesta entre 1785 y 1786 y estrenada en Viena el 1 de mayo de 1786 bajo la dirección del mismo compositor.'	,	to_date(	'4/02/2013'	, 'dd/mm/yyyy'),	6	,	4	,	6	,	1	,	10	,	4	);
insert into OBRA values (	9	,	'tristan e isolda'	,	'es una ópera en tres actos con música y libreto en alemán de Richard Wagner, basado en gran medida en el romance de Godofredo de Estrasburgo. Fue compuesta entre 1857 y 1859 y se estrenó en Múnich el 10 de junio de 1865, bajo la batuta de Hans von Bülow.'	,	to_date(	'13/10/2012'	, 'dd/mm/yyyy'),	2	,	5	,	5	,	2	,	6	,	5	);
insert into OBRA values (	2	,	'Don Pasquale'	,	' ópera bufa en tres actos con música de Gaetano Donizetti y libreto en italiano de G. Ruffini y el propio compositor, adaptado del texto de la ópera italiana Ser Marco Antonio, escrito por Angelo Anelli para Ser Marcantonio (1810) de Stefano Pavesi. '	,	to_date(	'13/12/2012'	, 'dd/mm/yyyy'),	3	,	6	,	4	,	3	,	9	,	6	);
insert into OBRA values (	3	,	'El trovador '	,	'un drama romántico situado en la Zaragoza de la Edad Media. La mayor parte de la acción se desarrolla en una torre de planta rectangular del Palacio de la Aljafería. A raíz de este drama el pueblo comenzó a llamar a la torre como «del Trovador», denominación que perdura hasta el día de hoy y que ha sido adoptada por los eruditos en estudios versados sobre el castillo de la capital aragonesa.'	,	to_date(	'12/11/2012'	, 'dd/mm/yyyy'),	4	,	7	,	3	,	4	,	8	,	7	);
insert into OBRA values (	1	,	'El elixir de amor'	,	'es una de las más interpretadas de óperas de Donizetti todos: combina una historia de amor conmovedora y divertida comedia con música hermosa, incluyendo el muy querido aria Una furtiva lagrima. Su estreno en Milán en 1832, fue un triunfo y aseguró su lugar de Donizetti como uno de los compositores de ópera más importantes italianos de su época.'	,	to_date(	'10/01/2013'	, 'dd/mm/yyyy'),	5	,	8	,	2	,	5	,	7	,	8	);
insert into OBRA values (	4	,	'la boheme'	,	'Refleja las vivencias de Puccini durante los años de estudiante en el conservatorio de Milan, donde compartio habitacion con Pietro Mascagni.'	,	to_date(	'08/12/2012'	, 'dd/mm/yyyy'),	1	,	9	,	1	,	6	,	6	,	9	);
